import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, TouchableOpacity, Text, View } from 'react-native';
import logo from './assets/Logo.png'

const styles = StyleSheet.create({
  page: {
    flex: 1,
    backgroundColor: '#252B63',
    alignItems: 'center',
  },
  textpos:{
    position: 'absolute',
    top: '50%',
  },
  picpos:{
    position: 'relative',
    width: '15%'
  },
  maintext:{
    font: 'Poppins',
    'font-weight': 'bold',
    color: 'white',
    'font-size': '25px',

  },
  subtext:{
    font: 'Poppins',
    color: 'white',
    'font-size': '20px',
  },
    appButtonContainer: {
    elevation: 12,
    backgroundColor: "white",
    borderRadius: 15,
    paddingVertical: 12,
    width: '25%',
    aspectRatio: 1/10,
    position: 'absolute',
    top: '80%'
  },
  appButtonText: {
    fontSize: 18,
    color: "#252B63",
    fontWeight: "bold",
    alignSelf: "center",
  },
});

const PB = ({ onPress, title }) => (
  <TouchableOpacity onPress={onPress} style={styles.appButtonContainer}>
    <Text style={styles.appButtonText}>{title}</Text>
  </TouchableOpacity>
);


 function App() {
  return (
    <View style={styles.page}>
      <View style={styles.picpos}>
        <img width={'100%'} src={logo}/>
      </View>
      <View style={styles.textpos}>
        <Text style={styles.maintext}>Get your Priority </Text>
        <Text style={styles.subtext}>Easy way to get ahead!</Text>
      </View>
      <PB title="Let's Get Started"/>
    </View>
  );
}






export default App
